import React, { Component } from 'react';
import axios from 'axios';

export default class createContent extends Component {
  state = {
    queuename: '',
    payload: '',
  };

  onSubmit(e) {
    e.preventDefault();
    const obj = {
      queuename: '',
      payload: '',
    };
    axios
      .post('http://localhost:8000/post/msg', obj)
      .then((res) => console.log(res.data));
  }

  render() {
    return (
      <div style={{ marginTop: 10 }} className="heading-list">
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <input type="hidden" value="user" onChange={this.handleChange} />
            <input
              type="hidden"
              value="sent from react"
              onChange={this.handleChange}
            />
            <input type="submit" value="Submit" />
          </div>
        </form>
      </div>
    );
  }
}
